import React from "react";
import Model from "../models/Model.js";
export default class List extends React.Component {
    constructor(props) {
        super(props);
        console.log("In List");
        this.state = {
            list:props.list
        }
        console.log(this.state.list);
    }


    render() {
        return (
            <div className="List">
                {this.state.list.map((data)=>{
                    <div className = "col-lg-4">
                        {data.state}
                    </div>
                })}
            </div>
        )
    }
}
